import Hero_Bg from "../../assets/Hero.jpg";
import Hero_Video from "../../assets/Hero_Bg.mp4";

const Hero = () => {
  return (
    <section
      className="h-screen bg-fullcenter relative"
      style={{ backgroundImage: "url(" + Hero_Bg + ")" }}
    >
      <video
        autoPlay
        muted
        loop
        className="absolute bg-fullobject w-full h-screen"
      >
        <source
          src={Hero_Video}
          type={`video/${Hero_Video.split(".").pop()}`}
        />
        Your browser does not support the video tag.
      </video>
      <div className="mx-auto max-w-[800px] text-center padding">
        <div className="text-7xl">
          <h1 className="text-slate-50">امپــراتـــوری</h1>
          <h1 className="text-red-600">کــــــــــــــــــد</h1>
        </div>
      </div>
    </section>
  );
};

export default Hero;
